?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">На мировом часовом рынке, компания Jacob &amp; Co. появилась примерно 25 лет назад, но всемирную популярность приобрела совсем недавно. Марка была зарождена в Соединенных Штатах, знаменитым ювелиром Джейкобом Арабо. Интересно, что Джейкоб становится знаменитым не как другие производители (постепенно, в течение долгого времени), а очень быстро. И, по большому счету, известным он стал благодаря американской певице, которую звали Фейт Эванс. Дело в том, что певица как раз заканчивала долгую работу над своим новым альбомом. Но помимо этого, потребовалось его оформить. После недолгих раздумий, Фейт Эванс решила использовать в оформлении своего альбома украшения Джейкоба Арабо. И, буквально через неделю, на Jacob &amp; Co. посыпались, различного рода, заказы. С середины 90-х годов, компанию не покидает популярность, а, производимые ею элитные часы из драгоценных металлов, легко заняли лидерские позиции на производственно рынке часов класса люкс. Особенно популярной считается модель «The 5 time zone».&nbsp;Это тонкие часы, которые могут одновременно показывать время в разных часовых поясах мира. Главный циферблат настраивается на местно время, а вот остальные отображают время Парижа, Токио, Нью-Йорка&nbsp;и Лос-Анджелеса. Стоит отметить, что часы компании Jacob &amp; Co. носят очень известные люди, например, Майкл Джордан. Благородные бриллианты вместе с белым золотом, да еще с учетом надежности и точности механизмов, никого не могут оставить равнодушным.&nbsp;</span></span></p>
 
